bwc='DialogBox$MouseHandler',dpc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Qzc='Dimension',glc='Dimension [height=',dwc='DirectionalTextHelper',gwc='DockLayoutPanel',hwc='DockLayoutPanel$Direction',iwc='DockLayoutPanel$Direction;',lwc='DockLayoutPanel$DockAnimateCommand',jwc='DockLayoutPanel$LayoutData',msc='DomEvent',rsc='DomEvent$Type',yyc='Double',fic='EAST',_cc='EEE, d MMM yyyy HH:mm:ss Z',$nc='EEE. dd MMM. yyyy HH:mm:ss',tdc='EEEE, MMMM d',cdc='EEEE, MMMM d, y',Cac='EM',hgc='EMPTY',mgc='ENABLED',Gec='END',Eac='EX',Iuc='ElementMapperImpl',Juc='ElementMapperImpl$FreeNode',vec='English',yrc='Enum',mec='Etc/GMT',oec='Etc/GMT+',nec='Etc/GMT-',Xac='Event type',Exc='Event$NativePreviewEvent',Esc='EventBus',Lqc='EventObject',Qqc='Exception',Kgc='Expecting version 6 from server, got ',Sbc='F',hmc='F8834F07517EF3B7D02B9E845E5E1B88',xac='FIXED',ghc='FLOAT',Olc='Fail: ',kcc='Feb',$bc='February',Epc='Female',zyc='Float',mwc='FlowPanel',Bvc='FocusImpl',Dvc='FocusImplSafari',Cvc='FocusImplStandard',Mvc='FocusWidget',ikc='For input string: "',Occ='Fri',Hcc='Friday',jbc='GET',poc='GGD55XLBAH',aqc='GGD55XLBAJ',npc='GGD55XLBBI',ooc='GGD55XLBCH',ppc='GGD55XLBCI',Kfc='GGD55XLBDB',noc='GGD55XLBDH',jqc='GGD55XLBDJ',Yoc='GGD55XLBDK',xfc='GGD55XLBEB',loc='GGD55XLBEH',opc='GGD55XLBEI',bqc='GGD55XLBEJ',Lfc='GGD55XLBFB',soc='GGD55XLBFH',Mpc='GGD55XLBFI',Cqc='GGD55XLBFK',Jpc='GGD55XLBGI',Aqc='GGD55XLBGK',Ofc='GGD55XLBHB',Aoc='GGD55XLBHH',xpc='GGD55XLBHI',zqc='GGD55XLBHK',Coc='GGD55XLBIH',wqc='GGD55XLBIK',Boc='GGD55XLBJH',xnc='GGD55XLBJJ',Bqc='GGD55XLBJK',Noc='GGD55XLBKG',ipc='GGD55XLBKH',Npc='GGD55XLBKI',rqc='GGD55XLBKK',Koc='GGD55XLBLG',hpc='GGD55XLBLH',Fpc='GGD55XLBLI',sqc='GGD55XLBLK',Roc='GGD55XLBMG',gpc='GGD55XLBMH',Bnc='GGD55XLBMJ',Poc='GGD55XLBNG',fpc='GGD55XLBNH',qqc='GGD55XLBNK',cnc='GGD55XLBOG',jp
